      <div style={{ display: 'flex' }}>
        <Sideview/>
        <div style={{ flex: 1 }}>
          {/* <Messageview/> */}
          {/* <Textinput/> */}
        </div>
      </div>
      <Footer/>
    </div>
  )
}

export default Home
